import React from "react";
import Song from "../data/songs.json";

class SongListTestB extends React.Component {
  render() {
    return (
      <div>
        <table>
          <tr>
            <th>Artist</th>
            <th>Title</th>
          </tr>
          {
          Song.filter(song => song.artist.includes("Ed")).filter(song => song.title.includes("")).map((Song) => {
            return (
              <tr>
                <td>{Song.artist}</td>
                <td>{Song.title}</td>
              </tr>
            );
          })
          }
        </table>
      </div>
    );
  }
}

export default SongListTestB;
